// setupTestService creates a service struct with a mock http client
func setupTestService(responseType wmata.ResponseType) *Service {
	wmataClient := wmata.Client{
		HTTPClient: &testClient{},
	}
	return NewService(&wmataClient, responseType)
}

func TestGetNextTrains(t *testing.T) {
	for path := range testData {
		data := testData[path]
		testService := setupTestService(data.responseType)

		response, responseErr := testService.GetNextTrains(data.param)

		if responseErr != nil {
			if data.expectedError == nil || responseErr.Error() != data.expectedError.Error() {
				t.Errorf("unexpected error: %s", responseErr)
			}
			continue
		}

		if !reflect.DeepEqual(response, data.unmarshalledResponse) {
			t.Error(pretty.Diff(response, data.unmarshalledResponse))
		}
	}
}
